import React from 'react';
import { PageContainer, PageTitleOne, PageTitleTwo, PageText, PageAnchorTag } from '../global-page-styles/global-page-styles';
import { CustomButton } from '../../components/custom-button/custom-button.component';
import {Helmet} from "react-helmet";

const AboutPage = (props) =>{

  return (
    <PageContainer>
    <Helmet>
        <title>About</title>
        <meta name="about" content="About Dale Street Studio, LLC" />
    </Helmet>
    <PageTitleOne className='date'>About</PageTitleOne>
    <PageTitleTwo>Description</PageTitleTwo>
    <PageText>Dale Street Studio is home to recording artist & producer Marcus Dale Norwood aka M.D. Norwood & DJ Definition. Representing his expanding studio, growing sound as a singer/songwriter and 20+ years of experience in audio between production, mixing & mastering services. Plus being an avid blues guitarist and scratch DJ.
    </PageText>
    <PageTitleTwo>Booking</PageTitleTwo>
    <PageText style={{marginBottom: '45px'}}>Most of the time I'm locked away recording or writing something for my projects. I also love helping other artists success in their sound. So I offer production, mixing, mastering and audio cleanup. In addition to guitar, scratch and vocals. 
    </PageText>
    <center><a href={'http://eepurl.com/hyqpfb'}><CustomButton style={{textAlign: 'center'}}><span style={{paddingRight: '10px'}} role="img" aria-label="contact">&#x1f4e9;</span>Contact to Book Services</CustomButton></a></center>


    </PageContainer>
  )
};




export default React.memo(AboutPage);
